import React from 'react'

const AboutProducts = () => {
  return (
    <div>
        <section className="services section" id="services">
            <h2 className="section__title">Services</h2>
            <span className="section__subtitle">What I offer</span>
        </section>
    </div>
  )
}

export default AboutProducts
